;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/metrics</span>","value":"#'algebolic.demo.spea2/metrics"}
;; <=

;; @@
(time (def result (evolution/run-evolution run-config metrics)))
